import React, { Component } from "react";
import * as Bootstrap from "react-bootstrap";
import { TextField } from "material-ui";
export default class Inputs extends Component {
  render() {
    return (
      <div>
        <div id="Email">
        <Bootstrap.FormText
        label="Email*"
        type="text"
        name="Username"

        autoComplete="Username"
        margin="normal"
        variant="filled"
    />
        </div>


      </div>
    );
  }
}
